import React from'react';

const MenuCard =({menuData })=>{
    console.log(menuData);
    return (<>
    {menuData.map((curElem,index)=>{
        return(<>
            <div class="row">
        <div class="col-12 col-md-8">
         <div className="container" key={curElem.id}>
      <section>
               
                <img className="card-img-top" src={curElem.image} style={{width:"200px",height:"200px"}}  alt="Card image cap"/>
                <div className="card-body">
                    <h5 className="card-title">{curElem.id}</h5>
                    <h4>{curElem.category}</h4>
                    <h2>{curElem.name}</h2>
                    <span >{curElem.description}</span><br></br>
                    <button className="btn btn-success">Order Now</button>
                </div>
              
               
                
      </section>
  </div></div>
  
</div>



           


        </>

        )
    })}
    
    
    </>)
}
export default MenuCard;
